import React from 'react';
import '../App'

class Navigation extends React.Component {
    render() {
        return (
            <nav className="navbar navbar-dark bg-dark">
                <a href="" className="text-white">
                    Home
                </a>
            </nav>
        );
    }
}

export default Navigation;
